  false,\n\t\"url\": null,\n\t\"notes\": \" Then               Topological Faces /
  Area Landmark Relationship File (FACESAL.dbf) contains a recordn               for
  each face / area landmark relationship. Face refers to the areal (polygon)n               topological
  primitives that make up MTDB. A face is bounded by one or more edges; itsn               boundary
  includes only the edges that separate it from other faces, not any interiorn               edges
  contained within the area of the face. The face to which a record in then               Topological
  Faces / Area Landmark Relationship File (FACESAL.dbf) applies can ben               determined
  by linking to the Topological Faces Shapefile (FACES.shp) on the permanentn               topological
  face identifier (TFID) attribute. The area landmark to which a record inn               the
  Topological Faces / Area Landmark Relationship File (FACESAL.dbf) applies can ben
  \              determined by linking to the Area Landmark Shapefile (AREALM.shp)
  on the arean               landmark identifier (AREAID) attribute. A face may be
  part of multiple arean               landmarks. An area landmark may consist of
  multiple faces. \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
